- input: TEXT,F3XA,,"This amendment responds to your letter of December 17 2004 regarding
    this report.       The totals on Columns A and B on the Summary and Detailed Summary
    Pages should now be correct.       The cash-on-hand at the close of the reporting
    period and the calendar-year cash-on-hand amount are now the same.       The totals
    on the Schedule L Aggregation Page are also now correct. These errors were a result
    of software and entry problems we were experiencing.       With regard to transfers-out
    reported on Schedule L-B supporting Line 5 these are transfers to a nonfederal
    account made solely for the purpose of replenishing the party's nonfederal account.
    These funds will not be used in connection with a federal election or for Federal
    Election Activities.The account named Texas Democratic Party-Administrative is
    not a federal account an allocation account or a Levin acount. It is a nonfederal
    account and it is so-named because of the requirements of Texas law. We have routinely
    transferred funds out of the Levin account and out of our federal account because
    of the federal requirement to pay employees 100% nonfederally unless the employee
    must be paid 100% federally.",
