- input: TEXT,SA12,,"With regard to your inquiry about transfers-in from national
    party committees and disbursements on Schedule B for Line 21b for certain exempt
    activities please know that the committee understands the requirements for undertaking
    exempt activities. For exempt campaign materials we understand that no public
    advertising including direct mail is permissible; that the materials must be distributed
    by volunteers; and that none of the funds can have been designated for a particular
    candidate or transferred from a national party committee to specifically fund
    the activity.       The committee has received no transfer from any national party
    committee to fund any exempt activity. We also note that the committee's Line
    11 contributions and receipts from joint fundraising--receipts not from any national
    party committee--total more than the amount disbursed for exempt activities. We
    further note that the committee began the reporting period with cash-on-hand of
    more than $150000 of which none was composed of transfers from national party
    committees. Finally we note that the national party transfer in question was received
    after all but one of the disbursements for exempt activities had already been
    made.       ",
